import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <div>
            <Link to="/home">Home</Link>
            <Link to="/about">About</Link>
            <Link to="/friend">Friends</Link>
            <Link to="/"></Link>
        </div>
    );
};

export default Header;
